This question requires the understanding of two main concepts:

A) Recursive functions
B) GCD (Greatest Common Divisor) of two numbers

A) A Recursive function is a function that calls itself during execution. The idea of recursion is to solve a large problem by a "divide and conquer" approach. The larger problem is divided into smaller subproblems. And each of those subproblems is further divided into smaller sub-problems until we identify a sub-problem that we can solve quite easily. Once we solve the simplest sub-problem, we can use it to piece together the solution to the larger sub-problems until we solve our original problem.

B) The Greatest Common Divisor (GCD) of two natural numbers 'a' and 'b' is the largest number that divides both 'a' and 'b'. The most natural way to find the GCD of 'a' and 'b' is to list all the divisors of both 'a' and 'b' and then finding the largest divisor that belongs to both the lists. As you can imagine, this task becomes very difficult if 'a' and 'b' are large numbers.

The best way to solve this problem is by using Euler's algorithm. Euler's algorithm is based on the following principle:

"Let a and b be two numbers such that a is greater than b. Then, GCD(a, b) = GCD(a-b, b)."

For example, GCD (15, 12) = GCD(3, 12) = 3

While this principle looks like a simple observation, it is actually a powerful tool. As you can see, the principle essentially solves the problem of finding the GCD of 'a' and 'b', by finding the GCD of 'a-b' and 'b'. Note that since 'a-b' is actually smaller than 'a', it would be easier to find the GCD of 'a-b' and 'b'. But we needn't stop here! We can treat 'a-b' and 'b' as new numbers and apply this same principle once more. This way, with every repetition, we will keep reducing our numbers until we reach the case where the new "a" and "b" become equal (This is the easiest sub-problem to solve!). In this case, the GCD is simply the number itself, because a number is its own greatest divisor.

Consider once again the GCD of 12 and 15:

GCD (15, 12) = GCD (3, 12) = GCD (3, 9) = GCD (3, 6) = GCD (3, 3) = 3

Which is the answer we expected!

