int computeGCD (int a, int b)   //We define a function to compute the GCD of two numbers
{
    int gcd;

    if (a>b)           //We replace the bigger number by the difference between the two
        a = a - b;
    else if (a<b)   //We replace the bigger number by the difference between the two
        b = b -a;
    else               //But, in case the numbers are equal, the GCD is the number itself!
    {
        gcd = a;
        return gcd;    //In that case we output the number itself and terminate the function
    }

